	//经纬度转墨卡托
	// 经度(lon)，纬度(lat)
	public static double[] lonLat2Mercator(double lon,double lat)
	{
	double[] xy = new double[2];
	double x = lon *20037508.342789/180;
	double y = Math.log(Math.tan((90+lat)*M_PI/360))/(M_PI/180);
	y = y *20037508.34789/180;
	xy[0] = x;
	xy[1] = y;
	return xy;
	}
	//墨卡托转经纬度
	public static double[] Mercator2lonLat(double mercatorX,double mercatorY)
	{
		double[] xy = new double[2];
		double x = mercatorX/20037508.34*180;
		double y = mercatorY/20037508.34*180;
		y= 180/M_PI*(2*Math.atan(Math.exp(y*M_PI/180))-M_PI/2);
		xy[0] = x;
		xy[1] = y;
		return xy;
	}
	
	/**
	 * 判断点是否在面内
	 * @param point
	 * @param polygonring
	 * @return
	 */
	public static Boolean inside(double[] point,double[][] polygonring){
		double x = point[0];
		double y = point[1];
		Boolean inside = false;
		for (int i = 0, j = polygonring.length - 1; i < polygonring.length; j = i++) {
	        double xi = polygonring[i][0], yi = polygonring[i][1];
	        double xj = polygonring[j][0], yj = polygonring[j][1];
	
	        Boolean intersect = ((yi > y) != (yj > y))
	            && (x < (xj - xi) * (y - yi) / (yj - yi) + xi);
	        if (intersect) inside = !inside;
	    }
		return inside;
	}
	
	/**
	 * 判断经纬度是否在天津市内
	 * @param point
	 * @return
	 */
	public static Boolean insideTianjin(double[] point){
		return inside(point,tjArea);
	}
	
